import React from 'react';
// import '../styles/navbar.css';

const Navbar = ({ size, setShow }) => {
    return (
        <nav>
            <div className="">
                <span className="my_" onClick={() => setShow(true)}>
                    My Shopping
                </span>
                <div className="cart" onClick={() => setShow(false)}>
                    <span>
                        <i className="">Submit</i>
                    </span>
                    <span>{size}</span>
                </div>
            </div>
        </nav>
    )
}

export default Navbar
